-- Set default schema to use for the following queries
SET search_path TO "utility";

DROP TABLE IF EXISTS "country";

CREATE TABLE "country" (
  "id" char(2) NOT NULL PRIMARY KEY,
  "alpha3" char(3) NOT NULL,
  "m49" char(3) NOT NULL,
  "name" varchar(100) NOT NULL,
  "native_name" varchar(100) NOT NULL,
  "emoji" char(2) NOT NULL,
  "phone_code" varchar(20) NOT NULL,
  "tld" char(3) NOT NULL,
  "region_id" char(3) NOT NULL,
  "timezones" JSONB NOT NULL,
  "translations" JSONB NOT NULL,
  "created_at" timestamptz NOT NULL DEFAULT NOW(),
  "updated_at" timestamptz NOT NULL DEFAULT NOW(),
  CONSTRAINT country_region_fk FOREIGN KEY (region_id) REFERENCES region(id) ON UPDATE RESTRICT ON DELETE RESTRICT
);

-- https://en.wikipedia.org/wiki/ISO_3166-1_alpha-2
COMMENT ON COLUMN country.id IS 'ISO 3166-1 alpha-2';

-- https://en.wikipedia.org/wiki/ISO_3166-1_alpha-3
COMMENT ON COLUMN country.alpha3 IS 'ISO 3166-1 alpha-3';

-- https://en.wikipedia.org/wiki/UN_M49
COMMENT ON COLUMN country.m49 IS 'UN M49';

CREATE TRIGGER set_country_updated_at before
UPDATE ON "country" FOR each ROW EXECUTE PROCEDURE set_current_timestamp_updated_at();

